import React from 'react';
import './about.css';

const About = () => {
    return (
        <div className="a">
            <div className="a-left">
                <div className="a-card"></div>
                <div className="a-card">
                    <img src="https://images.pexels.com/photos/10319218/pexels-photo-10319218.jpeg?auto=compress&cs=tinysrgb&dpr=2&w=500" alt="" className="a-img" />
                </div>
            </div>
            <div className="a-right"></div>
        </div>
    );
};

export default About;
